Born to an Eritrean Father and Egyptian mother; composer, producer and musician Ahmed Omar was always interested in how African and Oriental cultures could intertwine in music. Ahmed brought together musicians with unique African traditional backgrounds to create a diverse musical dialogue, blended with contemporary approaches,  to make the music that became the successful  'Africairo' project.

&nbsp;

&nbsp;

Known as the 'Dean of Jazz Musicians' in Lebanon, Armenian Lebanon-based pianist Arthur Satyan is one of the most important and influential jazz musicians in the region. Professor of Classical Piano at the Lebanese National Conservatory of Music since 1998, he has taught, influenced and inspired many and has p<span class="text_exposed_show">erformed with an array of international stars and jazz giants like Larry Coryell, Charles Davis, Ray Vega, Ed Cherry and Joe Lee Wilson, just to name few.</span>

